<template>
	<view class="orderSettlementContainer">
		<view class="orderSettlement">
			<view class="content">
				<view class="adress" @click="jump">
					<view class="adress_icon">
						<view class="left_icon">
							<text class="iconfont icon-location"></text>
							<view class="default" v-if="defaultAddress">默认</view>
						</view>
					</view>
					<view class="adress_text">
						<view class="user_receive">
							<text>收货人：{{address.consignee || "无"}}</text>
							<text>{{address.mobile || ""}}</text>
						</view>
						<view class="user_adress">
							<text>收货地址：<text v-if="!address.countryId">请选择收货地址</text><text v-if="address.countryId"> {{address.countryId }}{{address.provinceId}}{{address.cityId }}{{address.districtId }}{{address.address }}</text></text>
						</view>
					</view>
					<view class="icon">
						<text class="iconfont icon-xiangyou"></text>
					</view>
					<image src="../../static/images/orderSettlement/header_logo.png" mode=""></image>
				</view>

				<!-- 商品列表 -->
				<view class="good-list">
					<view class="item" v-for="(item,index) in storeGoodList" :key="index">
						<view class="good_img">
							<view class="img">


								<image v-if="item.imageUrl" :src="item.imageUrl" mode=""></image>
								<image v-if="!item.imageUrl" src="data:image/png;base64,"
								 mode=""></image>
							</view>
						</view>
						<view class="good_detail">
							<view class="header">{{item.goodsName}}</view>
							<view class="body" v-if="item.specLis&&item.specLis.length>0">规格：<text v-for="(item1,index1) in item.specLis"
								 :key="index1">{{item1}}</text></view>
							<view class="bottom">
								<text class="price">
									￥ {{item.goodsPrice || '0.00'}} <text v-if="Number(item.point)>0">+ {{item.point}}积分</text>
								</text>
								<text class="count">x {{item.goodsTotal}}</text>
							</view>
						</view>
					</view>
				</view>
				<!-- 费用明细 -->
				<view class="chargesDetail">
					<view class="header">
						费用明细
					</view>
					<view class="body">
						<view class="item">
							<text>商品总计</text>
							<text>￥ {{priceAll|| '0'}} </text>
						</view>
						<!-- 		<view class="item">
							<text>运费</text>
							<text>￥ 50.00</text>
						</view> -->
						<view class="item">
							<text>消耗积分</text>
							<text> {{pointAll||'0'}}积分</text>
						</view>
						<view class="item">
							<text>运费</text>
							<text> ￥{{freightChargeCount||'0'}}</text>
						</view>
						<view class="item">
							<text>总计</text>
							<text>￥{{((priceAll*100)+(freightChargeCount*100))/100|| '0'}} + {{pointAll||'0'}}积分 </text>
						</view>
					</view>
				</view>
				<view class="chargesDetail" style="min-height: 30upx;">
					<view class="body">
						<view class="item">
							<text>赠送积分</text>
							<text>{{totalCoin|| '0'}} </text>
						</view>
					</view>
				</view>
				<!-- 支付 -->
				<view class="payMethods">
					<view class="header">
						支付方式
					</view>
					<view class="body">
						<radio-group @change="radioChange">
							<view class="item" v-if="(priceAll+freightChargeCount)!==0">

								<view class="weChat">
									<text class="iconfont icon-weixin"></text>
									<view class="text">
										<text> 微信支付</text>
										<text> 微信安全支付</text>
									</view>
								</view>
								<label class="radio">
									<radio value="wxpay" :checked="0 === Number(current)" /></label>
							</view>
							<!--  #ifdef APP-PLUS-->
							<view class="item" v-if="(priceAll+freightChargeCount)!==0">
								<view class="payPage">
									<text class="iconfont icon-circle-alipay"></text>
									<view class="text">
										<text> 支付宝支付</text>
										<text> 支付宝安全支付</text>
									</view>
								</view>
								<label class="radio">
									<radio value="alipay" :checked="1 === Number(current)" /></label>
							</view>
							<!--  #endif-->
							<!-- this.priceAll+this.freightChargeCount -->
							<view class="item" v-if="(priceAll+freightChargeCount)===0">
								<view class="payPage">
									<view style="width: 24px;height: 24px;">
										<image style="width: 100%;height: 100%;" src="../../static/images/index/pt.png" mode=""></image>
									</view>
									<view class="text">
										<text> 积分支付</text>
										<text> 积分兑换支付</text>
									</view>
								</view>
								<label class="radio">
									<radio value="piont" :checked="2 === Number(current)" /></label>
							</view>
						</radio-group>
					</view>
				</view>
				<view class="commit">
					<text class="text" style="margin-left: 10px; ">订单备注：</text>
					<input type="text" v-model="produceOrder.remark" placeholder="给卖家留言（30字以内）" maxlength="30" />
				</view>
			</view>
		</view>

		<view class="navbar">
			<view class="left">
				<text class="pay">需要支付</text> <text class="price">￥{{((priceAll*100)+(freightChargeCount*100))/100|| '0'}} +{{pointAll||'0'}}积分</text>
			</view>
			<view class="right back" v-if="clickTime===1"  >
				立即支付
			</view>
			<view class="right " v-if="clickTime===0"  @click="paySettlement">
				立即支付
			</view>
		</view>
	</view>
</template>

<script>
	// #ifdef H5
	import initJssdkCon from '../../common/jssdk.js'
	let jweixin = require('jweixin-module')
	// #endif
	export default {
		data() {
			return {
				defaultAddress: true,
				current: 0,
				clickTime: 0,
				payType: 'wxpay',
				userId: '',
				address: {},
				produceOrder: {
					"memberId": "",
					"tradeNo": "",
					"addressId": "",
					"payWay": 2,
					"totalAmount": "",
					"totalCount": "",
					"totalPoint": "",
					"remark": "",
					"detail": []
				},
				orderInfo: {},
				storeInfo: {},
				storeGoodList: [],
				totalCoin: 0,
				getOrderObj: {},
				freightChargeCount: 0,
				freightArr: [],
				payMethods: '',
				shoppingCartArr: [],
				addressStorage: {},
				rankFlag:'',
				showPay:false,
				timeId:''
			}
		},
		computed: {
			//积分总数
			pointAll() {
				let count = 0
				for (let item of this.storeGoodList) {
					count += Number(item.point)
				}
				return count
			},
			priceAll() {
				console.log(this.storeGoodList)
				let count = 0
				for (let item of this.storeGoodList) {
					
					count += Number(item.goodsAmountPrice)
				}

				console.log(count)
				return count
			},
			countAll() {
				let count = 0
				for (let item of this.storeGoodList) {
					count += Number(item.goodsTotal)
				}
				return count
			}
		},
		async onShow() {
			// #ifdef H5
			initJssdkCon.initJssdkCon(window.location.href.split("#")[0]).then((res) => {
				console.warn(res)
				jweixin.config({
					beta: true, // 必须这么写，否则wx.invoke调用形式的jsapi会有问题
					debug: false, // 开启调试模式,调用的所有api的返回值会在客户端alert出来，若要查看传入的参数，可以在pc端打开，参数信息会通过log打出，仅在pc端时才会打印。
					appId: res.data.data.appId, // 必填，企业微信的corpID
					timestamp: res.data.data.timestamp, // 必填，生成签名的时间戳
					nonceStr: res.data.data.nonceStr, // 必填，生成签名的随机串
					signature: res.data.data.signature, // 必填，签名，见附录1
					jsApiList: ['chooseWXPay'] // 必填，需要使用的JS接口列表，所有JS接口列表见附录2
				})
				jweixin.ready(() => {
					console.log("如论成功与否")
				});
				jweixin.error((res) => {
					// alert('jssdk验证失败')
					console.warn('jssdk验证失败')
				})
			})
			// #endif
			this.address = []
			this.storeGoodList = []
			this.totalCoin = []
			this.shoppingCartArr = []
			this.userId = this.$common.getStorageSync("loginAddUseMessage").id
			this.addressStorage = this.$common.getStorageSync("address")
			let getOrderObj = {}
			if (JSON.stringify(this.$store.state.orderObj) !== '{}') {
				getOrderObj = this.$store.state.orderObj
			} else {
				getOrderObj = this.$common.getStorageSync("orderObj")
			}
			this.payMethods = getOrderObj.type
			let goodIdArr = []
			let skuCountList = []

			//购物车
			if (getOrderObj.type === 'shoppingCart') {

				let dataArr = getOrderObj.data
				let arr = []
				let num = 0
				console.log("dataArr", dataArr)
				dataArr.map((element) => {
					this.shoppingCartArr.push(element.cartId)
					skuCountList.push(element.num)
					//如果是活动商品
					if(element.activeSku){
						num += (Number(element.activeSku.presentCoin) * Number(element.num))
						goodIdArr.push(element.activeSku.id)
						arr.push({
							goodsName: element.activeSku.skuName, //商品名字
							goodsPrice: element.activeSku.activePrice, //商品价格
							imageUrl: element.activeSku.skuPicture, //商品图片
							point: Number(element.activeSku.consumeCoin) * Number(element.num), //扣除积分
							specLis: element.specList, //规格
							goodsTotal: element.num,
							"goodsId": element.activeSku.id,
							"shopId": element.activeSku.shopId,
							"goodsAmountPrice": Number(element.activeSku.activePrice) * Number(element.num),
							"presentCoin": Number(element.activeSku.presentCoin) * Number(element.num)
						})
					}else{
						num += (Number(element.goodsSku.giftPoint) * Number(element.num))
						goodIdArr.push(element.goodsSku.id)
						
						arr.push({
							goodsName: element.goodsSku.skuName, //商品名字
							goodsPrice: element.goodsSku.price, //商品价格
							imageUrl: element.goodsSku.skuPicture, //商品图片
							point: Number(element.goodsSku.point) * Number(element.num), //扣除积分
							specLis: element.specList, //规格
							goodsTotal: element.num,
							"goodsId": element.goodsSku.id,
							"shopId": element.goodsSku.shopId,
							"goodsAmountPrice": Number(element.goodsSku.price) * Number(element.num),
							"presentCoin": Number(element.goodsSku.giftPoint) * Number(element.num)
						})
					}
					
				})

				this.totalCoin = num
				this.storeGoodList = arr
				console.log('this.storeGoodList',this.storeGoodList)
			
			}



			//订单详情
			if (getOrderObj.type === 'product') {
				console.log('getOrderObj-product', getOrderObj)
				this.storeInfo = getOrderObj.data
				this.totalCoin = Number(this.storeInfo.presentCoin) * Number(this.storeInfo.num)
				skuCountList = [this.storeInfo.num]
				goodIdArr = [this.storeInfo.skuId]
				this.storeGoodList = [{
					goodsName: this.storeInfo.skuName,
					goodsPrice: this.storeInfo.goodsPrice,
					imageUrl: this.storeInfo.imageUrl ? this.storeInfo.imageUrl : "",
					point: Number(this.storeInfo.point) * Number(this.storeInfo.num),
					specLis: this.storeInfo.specList || [],
					goodsTotal: this.storeInfo.num,
					"goodsId": this.storeInfo.skuId,
					"shopId": this.storeInfo.shopId,
					"goodsAmountPrice": Number(this.storeInfo.goodsPrice) * Number(this.storeInfo.num),
					"presentCoin": Number(this.storeInfo.presentCoin) * Number(this.storeInfo.num)
				}]
			
				if(this.storeInfo.sourceUserId){
					this.getRank(this.storeInfo.sourceUserId)
				}
				
			}



			//订单详情
			if (getOrderObj.type === 'orderDetails') {
				this.storeInfo = getOrderObj.data
				this.produceOrder.tradeNo = this.storeInfo.tradeNo
				this.totalCoin = this.storeInfo.totalCoin
				this.storeInfo.shop.map((element) => {

					this.storeGoodList = this.storeGoodList.concat(element.detailList)
				})
				for (let s of this.storeGoodList) {
					goodIdArr.push(s.goodsId)
					skuCountList.push(s.goodsTotal)
				}
			}




			//我的订单
			if (getOrderObj.type === 'MeOrder') {
				this.storeInfo = getOrderObj.data
			
				this.produceOrder.tradeNo = this.storeInfo.tradeNo
				let num = 0
				this.storeInfo.shop.map((element) => {
					this.storeGoodList = this.storeGoodList.concat(element.detailList)
				})
				for (let s of this.storeGoodList) {
					num += Number(s.presentCoin)
					goodIdArr.push(s.goodsId)
					skuCountList.push(s.goodsTotal)
				}
				this.totalCoin = num
			}
			await this.getAddress(goodIdArr, skuCountList);
			
		},
		methods: {
			jump() {
				uni.navigateTo({
					url: '../addressManage/addressManage'
				})
			},
			getRank(id) {
				return new Promise((resolve, reject) => {
					this.$common.httpGet("/superior/member/getUserRank?userId=" + id).then((res) => {
						this.rankFlag = Number(res.data.data)
						console.log("this.rankFlag",this.rankFlag)
						resolve(res)
					})
				})
			},
			getAddress(goodIdArr, skuCountList) {
				return new Promise((resolve, reject) => {
					this.$common.httpGet("/mallUser/address/list?userId=" + this.userId, true).then((data) => {
						let dataAddress = data.data.data || []

						if (!this.addressStorage) {
							this.addressStorage = {}
						}
						dataAddress.map((element) => {

							if (JSON.stringify(this.addressStorage) !== '{}') {
								if (Number(this.addressStorage.id) === Number(element.id)) {
									if (element.isDefault) {
										this.address = element
										this.defaultAddress = true
										this.getFreightCharge(element.id, goodIdArr, skuCountList)

									} else {
										this.address = element
										this.defaultAddress = false
										this.getFreightCharge(element.id, goodIdArr, skuCountList)
									}
								}
							} else {
								if (element.isDefault) {
									this.address = element
									this.defaultAddress = true
									this.getFreightCharge(element.id, goodIdArr, skuCountList)
									return false
								}
							}

						})
					})
					resolve(true)
				})

			},
			getFreightCharge(id, goodIdArr, skuCountList) {
			

				this.$common.httpGet("/mall-order/shippingRegionLimits/getFreight?addressId=" + id + "&skuIdList=" + goodIdArr.join(
					",") + "&skuCountList=" + skuCountList.join(
					",")).then((data) => {
					if (Number(data.data.code) === 200) {
						this.freightChargeCount = Number(data.data.desc)
						this.freightArr = data.data.data
						if (this.priceAll+this.freightChargeCount === 0) {
						
							this.current = 2
							this.payType = 'point'
						}else{
							this.current = 0
							this.payType = 'wxpay'
						}
					} else {
						this.$common.showToast(data.data.desc, 'none')
					}

				})
			},
			deleteShopping() {
				if (this.payMethods === 'shoppingCart') {
					if (this.shoppingCartArr.length > 0) {
						this.$common.httpGet('/ml/goodsOrderCart/delete/many?cartsId=' + this.shoppingCartArr).then((res) => {

							if (res.data.code === 20000) {
								// this.$common.showToast('删除成功！', 'none')
								console.log('删除', res)
							}
						})
					}

				}

			},
			paySettlement() {
				//把按钮置灰
				this.clickTime=1
				clearTimeout(this.timeId)
				//订单信息
				console.log('this.produceOrder', this.storeInfo)
				this.produceOrder.totalPoint = this.pointAll
				this.produceOrder.totalAmount = this.priceAll
				this.produceOrder.totalCount = this.countAll
				this.produceOrder.addressId = this.address.id
				this.produceOrder.memberId = this.userId
				this.produceOrder.totalCoin = this.totalCoin
				this.produceOrder.freightCharge = this.freightChargeCount || 0
				let newArray = []

				for (let item of this.storeGoodList) {
					newArray.push({
						"skuId": item.goodsId,
						"shopId": item.shopId,
						"goodsAmount": item.goodsAmountPrice,
						"goodsCount": item.goodsTotal,
						"point": item.point,
						"presentCoin": item.presentCoin,
						"freight": 0
					})
				}

				for (let FreightItem of this.freightArr) {
					for (let newItem of newArray) {
						if (FreightItem.skuId === newItem.skuId) {
							newItem['freight'] = FreightItem.totalFreight
						}
					}
				}
				this.produceOrder.detail = newArray
				console.log(this.produceOrder)
				//1. 通过后台获取订单信息：
				//2第三步调起微信/支付宝支付
				if (!this.produceOrder.addressId) {
					this.$common.showToast("请选择选择收货地址", 'none')
					return false
				}
				if (!this.payType) {
					this.$common.showToast("请选择支付类型", 'none')
					return false
				}
				let typePay = ''
				if (this.payType === 'wxpay') {
					typePay = 'wxpay'
					this.produceOrder.payWay = '1'
				}
				if (this.payType === 'alipay') {
					this.produceOrder.payWay = '2'
					typePay = 'alipay'
				}
				if (this.payType === 'point') {
					this.produceOrder.payWay = '3'
					typePay = 'point'
				}
				// #ifdef H5
				this.produceOrder.openId = this.$common.getStorageSync("loginAddUseMessage").openId
				this.produceOrder.source = 0
				if(this.rankFlag>0){
					this.produceOrder.excellent=true
				}else{
					this.produceOrder.excellent=false
				}
				console.log("this.produceOrder",this.produceOrder)
				// #endif
				// #ifdef APP-PLUS
				if (uni.getSystemInfoSync().platform === 'android') {
					this.produceOrder.source = 2
				} else {
					this.produceOrder.source = 1
				}
				// #endif

				this.$common.httpPost("/mall-order/goodsTradeInfo/produceOrder", this.produceOrder).then((data) => {
					if (Number(data.data.code) === 200) {

						if (typePay !== 'point') {
							let that = this
							let payData = data.data.data
							this.produceOrder.tradeNo = data.data.desc || ""
								this.timeId=setTimeout(()=>{
										this.clickTime=0
								},2000)
							// #ifdef APP-PLUS
							if (Number(this.produceOrder.payWay) === 1) {
								uni.requestPayment({
									provider: 'wxpay',
									timeStamp: JSON.stringify(payData.timestamp),
									nonceStr: payData.noncestr,
									package: payData.packageValue,
									signType: "MD5",
									paySign: payData.sign,
									orderInfo: JSON.stringify({
										appid: payData.appid,
										noncestr: payData.noncestr,
										package: payData.packageValue,
										partnerid: payData.partnerid,
										prepayid: payData.prepayid,
										timestamp: payData.timestamp,
										sign: payData.sign,
									}),
									success: (res) => {
										uni.redirectTo({
											url: '../MeOrder/MeOrder?navidx=0'
										})
										this.deleteShopping()
										this.$common.setStorageSync("address", {})

									},
									fail: (res) => {
										this.deleteShopping()
										uni.redirectTo({
											url: '../MeOrder/MeOrder?navidx=1'
										})

										this.$common.setStorageSync("address", {})
									}
								});

							} else {
								//支付宝对接
								let order = payData.split("\n")[0]
								uni.requestPayment({
									provider: 'alipay',
									orderInfo: order, //微信、支付宝订单数据
									success: (res) => {
										uni.redirectTo({
											url: '../MeOrder/MeOrder?navidx=0'
										})
										this.$common.setStorageSync("address", {})
										this.deleteShopping()
									},
									fail: (err) => {
										uni.redirectTo({
											url: '../MeOrder/MeOrder?navidx=1'
										})
										this.deleteShopping()
										this.$common.setStorageSync("address", {})
									}
								});
							}
							// #endif
							// #ifdef H5
							let thatH5 = this
							jweixin.chooseWXPay({
								timestamp: payData.timestamp, // 支付签名时间戳，注意微信jssdk中的所有使用timestamp字段均为小写。但最新版的支付后台生成签名使用的timeStamp字段名需大写其中的S字符
								nonceStr: payData.noncestr, // 支付签名随机串，不长于 32 位
								package: payData.packageValue, // 统一支付接口返回的prepay_id参数值，提交格式如：prepay_id=\*\*\*）
								paySign: payData.sign, // 支付签名
								signType: 'MD5',
								success: (res) => {
									// 支付成功后的回调函数
								
									if (res.errMsg == "chooseWXPay:ok") {
										this.deleteShopping()
										if (this.payMethods === 'product') {
											if (this.storeInfo.sourceUserId) {
												this.getProductDetail()
											}
										}
										thatH5.$common.setStorageSync("address", {})
										//支付成功
									
										uni.redirectTo({
											url: '../MeOrder/MeOrder?navidx=0'
										})
										
									} else {
										this.$common.showToast(res.errMsg, "none")
									}
								},
								cancel: (res) => {
									uni.redirectTo({
										url: '../MeOrder/MeOrder?navidx=1'
									})
									this.deleteShopping()
									this.$common.setStorageSync("address", {})
								}
							});
							// #endif

						} else {
							this.$common.showToast('支付成功', "success")
							setTimeout(() => {
								uni.redirectTo({
									url: '../MeOrder/MeOrder?navidx=0'
								})
								this.deleteShopping()
								this.$common.setStorageSync("address", {})
							}, 1500)

						}
					} else {
						this.$common.showToast(data.data.desc, "none")

					}
				})
			},
			getProductDetail() {
				let param = ''
				if (this.storeInfo.sourceUserId) {
					param = '&sourceUserId=' + this.storeInfo.sourceUserId
				} else {
					param = ""
				}

				console.log("到家了", "/mallUser/goods/isSuperiorUserOrGoods?doRedis=1&spuId=" + this.storeInfo.spuId +
					'&targetUserId=' + this.userId +
					param)
				this.$common.httpGet("/mallUser/goods/isSuperiorUserOrGoods?doRedis=1&spuId=" + this.storeInfo.spuId +
					'&targetUserId=' + this.userId +
					param
				).then((res) => {
					if (res.data.code === 200) {

						console.log('res', res)
					}
				})
			},
			radioChange(val) {
				
				if (val.detail.value === 'wxpay') {
					this.current = 0
				} else if (val.detail.value === 'alipay') {
					this.current = 1
				} else {
					this.current = 2
				}

				this.payType = val.detail.value
			}
		}
	}
</script>

